import * as React from 'react';
import Container from '@mui/material/Container';
import NavTabs from '../components/NavTabs';

export default function Layout() {
  return (
    <React.Fragment>
      <Container
        sx={{ flexGrow: 1, display: 'flex', height: 1 }}
      >
        <NavTabs />
      </Container>
    </React.Fragment>
  );
}
